package com.redhat.coolstore.model;

import java.io.Serializable;

import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.GeneratedValue;
import javax.persistence.GenerationType;
import javax.persistence.Id;
import javax.persistence.SequenceGenerator;
import javax.persistence.Table;

@Entity
@Table(name = "ORDER_ITEMS")
public class OrderItem implements Serializable {
    private static final long serialVersionUID = 64565445665456666L;

    @Id
    @Column(name="ID")
    @GeneratedValue(strategy = GenerationType.SEQUENCE, generator = "order_item_seq")
    @SequenceGenerator(name = "order_item_seq", sequenceName = "order_item_seq")
    private long id;

    private int quantity;

    private String productId;

    public OrderItem() {}

    public String getProductId() {
        return productId;
    }

    public void setProductId(String productId) {
        this.productId = productId;
    }

    public int getQuantity() {
        return quantity;
    }

    public void setQuantity(int quantity) {
        this.quantity = quantity;
    }

    @Override
    public String toString() {
        return "OrderItem [productId=" + productId + ", quantity=" + quantity + "]";
    }

}
```

## Additional Information

Note that we added the `@SequenceGenerator` annotation to specify the sequence name `order_item_seq`. This annotation is used to define a sequence generator, which is used to generate unique identifiers for the entity.

Also, make sure to run `hbm2ddl` with `hbm2ddl.auto=create` to obtain a list of DDL statements for the sequences, and create the sequence `order_item_seq` in the database.
